// ALL ST7735 OUTPUT MUST OCCUR IN MAIN
int main(void){ // final main
  __disable_irq();
  PLL_Init(); // set bus speed
  LaunchPad_Init();
  ST7735_InitPrintf();
    //note: if you colors are weird, see different options for
    // ST7735_InitR(INITR_REDTAB); inside ST7735_InitPrintf()
  ST7735_FillScreen(ST7735_BLACK);
  Sensor.Init(); // PB18 = ADC1 channel 5, slidepot
  Switch_Init(); // initialize switches
  LED_Init();    // initialize LED
  Sound_Init();  // initialize sound
  TExaS_Init(0,0,&TExaS_LaunchPadLogicPB27PB26); // PB27 and PB26
  
  // Initialize TimerG12 for 30Hz interrupts
  TimerG12_Init();  // Initialize timer hardware
  TimerG12_IntArm(2666666, 0);  // 80MHz/30Hz = 2,666,666, highest priority
  
  // initialize game state
  game.currentState = START_SCREEN;
  game.score = 0;
  game.lives = 3;
  game.level = 1;
  game.backgroundX = 0;
  game.backgroundFrame = 0;
  gameSemaphore = false;
  
  __enable_irq();

  while(1){
    // wait for semaphore
    if(gameSemaphore) {
        gameSemaphore = false;  // clear semaphore
        
        // Handle state-specific logic
        switch(game.currentState) {
            case START_SCREEN:
                // TODO: Implement start screen later
                game.currentState = PLAYING;  // Skip to playing state for now
                break;
                
            case PLAYING:
                // Update background position and frame
                game.backgroundX -= 2;  // Move 2 pixels per frame for smoother scrolling
                if(game.backgroundX <= -128) {  // Reset when scrolled off screen
                    game.backgroundX = 0;
                    game.backgroundFrame = (game.backgroundFrame + 1) % 3;  // Cycle between 0,1,2
                }
                
                // Draw scrolling background
                ST7735_FillScreen(ST7735_BLACK);
                
                // Draw the current background frame
                switch(game.backgroundFrame) {
                    case 0:
                        ST7735_DrawBitmap(game.backgroundX, 0, bg_spaceship_1, 128, 160);
                        break;
                    case 1:
                        ST7735_DrawBitmap(game.backgroundX, 0, bg_spaceship_2, 128, 160);
                        break;
                    case 2:
                        ST7735_DrawBitmap(game.backgroundX, 0, bg_spaceship_3, 128, 160);
                        break;
                }
                break;
                
            case PAUSED:
                // TODO: Implement pause state later
                break;
                
            case GAME_OVER:
                // TODO: Implement game over state later
                break;
        }
    }
  }
}
